                                                    <a
                                                        data-rr-ui-dropdown-item=""
                                                        className="dropdown-item"
                                                        onClick={userMenuBarHeader}
                                                    >My Wishlist</a>
                                                    <a href="#"
                                                        data-rr-ui-dropdown-item=""
                                                        className="dropdown-item" role="button"
                                                        // tabIndex="0"
                                                        onClick={logOutForm}
                                                    >Sign Out</a></div>
                                                :
                                                null
                                        }
                                    </div>
                                </div>
                                :
                                <div className="signin-btn">
                                    <Link to={'/sign-in'} className="btn">Sign In</Link>
                                </div>
