                    </div>
                    <nav className="nav">
                        <ul className="w-100">
                            <li><a href="/customer-service">Customer Service</a></li>
                            <li><a href="/best-seller">Best Sellers</a></li>
                            <li><a href="/become-seller-form">Become a Seller</a></li>
